import React from 'react'
import { Box } from '@mui/system'
import {useAppDispatch,useAppSelector} from '../../store';

const ShowReport = () => {
  const {userList} = useAppSelector((state)=> state.userReducer)
  return (
    <>
      <Box sx={{padding:'64px'}}>
         {userList}
      </Box>
    </>
  )
}

export default ShowReport
